function App() {
  return (
    <Router>
      <div>
        <div className='row'>
          <div className='col s12' id='paddingRemover'>
            <Jumbotron></Jumbotron>
          </div>
        </div>
        <Switch>
          <Route exact path='/' component={Home} />
          <Route exact path='/home' component={Home} />
          <Route exact path='/library' component={Library} />
          <Route component={NotFound} />
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
